var wOpt1Btn = new DzCheckBox( wOptGB );
wOpt1Btn.text = "Option 1";
wOpt1Btn.checked = true;
var wOpt2Btn = new DzCheckBox( wOptGB );
wOpt2Btn.text = "Option 2";
var wOpt3Btn = new DzCheckBox( wOptGB );
